describe("angular easypiechart directive",function(){var i,n;beforeEach(module("easypiechart")),beforeEach(inject(function(e,t){n=t,i=e})),it("should have percentage default value 0",function(){n.percent=null;var e=angular.element('<div easypiechart percent="percent" options="options"></div>');i(e)(n),n.$digest(),expect(e.isolateScope().percent).toBe(0)}),it("inserts the element with a canvas element",function(){n.percent=-45,n.options={};var e=angular.element('<div easypiechart percent="percent" options="options"></div>');i(e)(n),n.$digest(),expect(e.html()).toContain("canvas")}),it("gets the options right",function(){n.percent=0,n.options={animate:{duration:0,enabled:!1},barColor:"#2C3E50",scaleColor:!1,lineWidth:20,lineCap:"circle"};var e=angular.element('<div easypiechart percent="percent" options="options"></div>');i(e)(n),n.$digest(),expect(e.isolateScope().options.animate.duration).toBe(0),expect(e.isolateScope().options.lineCap).toBe("circle")}),it("has its own default options",function(){n.percent=0,n.options={};var e=angular.element('<div easypiechart percent="percent" options="options"></div>');i(e)(n),n.$digest(),expect(e.isolateScope().options.size).toBe(110),expect(e.isolateScope().options.animate.enabled).toBe(!0)}),it("takes size option the right way",function(){n.percent=0,n.options={size:200};var e=angular.element('<div easypiechart percent="percent" options="options"></div>');i(e)(n),n.$digest(),expect(e.html()).toContain('height="200"'),expect(e.html()).toContain('width="200"')})});